import React, { Component } from 'react'

class Results extends Component {
  render() {
    return (
        <div className="results-box">
          <div className="container">
            <h3>Results:</h3>
            <ul>
            {this.props.search.map((item,i) => {
              return "<li>"+item+"</li>";
            })}
              <li>

              </li>

            </ul>
          </div>
        </div>
    );
  }
}
export default Results
